import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import React, { useState } from 'react';
import {Button, Spinner} from 'react-bootstrap'

function App() {

  const [two, setTwo] = useState(true)
  const [three, setThree] = useState(true)
  const [four, setFour] = useState(true)
  const [five, setFive] = useState(true)
  const [six, setSix] = useState(true)
  const [seven, setSeven] = useState(true)
  const [eight, setEight] = useState(true)
  const [nine, setNine] = useState(true)
  const [ten, setTen] = useState(true)
  const [eleven, setEleven] = useState(true)
  const [twelve, setTwelve] = useState(true)

  const maxDiceValue = 6
  const minDiceValue = 1

  const [dice1, setDice1] = useState(0)
  const [dice2, setDice2] = useState(0)

  const [rolling, setRolling] = useState(false)

  const [currentValue, setCurrentValue] = useState(null)

  const handleDiceRoll = () => {
    setRolling(true)
    setTimeout(() => {
      let result1 = (Math.floor(Math.random() * (maxDiceValue - minDiceValue + 1)) + minDiceValue)
      let result2 = (Math.floor(Math.random() * (maxDiceValue - minDiceValue + 1)) + minDiceValue)

      setDice1(result1)
      setDice2(result2)

      setCurrentValue(result1 + result2)

      setRolling(false)
    }, 2000);
  }

  const handleSelectNumber = (number) => {
    switch (number) {
      case 2:
          setCurrentValue(currentValue - 2);
          setTwo(false);
        break
      case 3:
        return setCurrentValue(currentValue - 3)
      case 4:
        return setCurrentValue(currentValue - 4)
      case 5:
        return setCurrentValue(currentValue - 5)
      case 6:
        return setCurrentValue(currentValue - 6)
      case 7:
        return setCurrentValue(currentValue - 7)
      case 8:
        return setCurrentValue(currentValue - 8)
      case 9:
        return setCurrentValue(currentValue - 9)
      case 10:
        return setCurrentValue(currentValue - 10)
      case 11:
        return setCurrentValue(currentValue - 11)
      case 12:
        return setCurrentValue(currentValue - 12)
    }
  }


  return (
    <div>
        <Button variant={two ? "secondary" : "outline-secondary"} size="lg" disabled={currentValue < 2 && two} onClick={() => handleSelectNumber(2)}>{two ? ("2") : ("âœ”")}</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 3} onClick={() => setThree(false)}>3</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 4} onClick={() => setFour(false)}>4</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 5} onClick={() => setFive(false)}>5</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 6} onClick={() => setSix(false)}>6</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 7} onClick={() => setSeven(false)}>7</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 8} onClick={() => setEight(false)}>8</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 9} onClick={() => setNine(false)}>9</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 10} onClick={() => setTen(false)}>10</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 11} onClick={() => setEleven(false)}>11</Button>
        <Button variant="secondary" size="lg" disabled={currentValue < 12} onClick={() => setTwelve(false)}>12</Button>
          <br/>
        <Button variant="success">{rolling ? (<Spinner/>):(<h1>{dice1}</h1>)}</Button>
        <Button variant="success">{rolling ? (<Spinner/>):(<h1>{dice2}</h1>)}</Button>
        <br/>
        <Button variant="primary" disabled={!currentValue == 0} onClick={() => handleDiceRoll()}>Roll!</Button>
    </div>
  );
}

export default App;
